import "./App.css";
import Nav from "./Nav.js";

let namesys = [
  { name: "Ruslan Karaniewski" },
  { name: "Leonardo Davinci" },
  { name: "Fox Bernad" },
];

const List = (props) => {
  let names = props.names;

  let nameList = names.map((nameX) => {
    return <div key={nameX.name}>{nameX.name}</div>;
  });
  return <section>{nameList}</section>;
};

function App() {
  return (
    <>
      <Nav />
      <>
        <List names={namesys} />
      </>
    </>
  );
}

export default App;
